u10db\\u10d8\\u10e1 \\u10e8\\u10d8\\u10dc\\u10d0\\u10d0\\u10e0\\u10e1\\u10d6\\u10d4 \\u10e1\\u10e0\\u10e3\\u10da\\u10d0\\u10d3 \\u10de\\u10d0\\u10e1\\u10e3\\u10ee\\u10d8\\u10e1\\u10db\\u10d2\\u10d4\\u10d1\\u10d4\\u10da\\u10d8\\u10d0 \\u201e\\u10d2\\u10d0\\u10d3\\u10d0\\u10d5\\u10d0\\u10e0\\u10e9\\u10d8\\u10dc\\u10dd\\u10d7 \\u10d1\\u10d0\\u10d5\\u10e8\\u10d5\\u10d4\\u10d1\\u10d8\\u201c \\u10d3\\u10d0 \\u201e\\u10d0\\u10ee\\u10d0\\u10da\\u10d2\\u10d0\\u10d6\\u10e0\\u10d3\\u10dd\\u10d1\\u10d8\\u10e1 \\u10e1\\u10d0\\u10d0\\u10d2\\u10d4\\u10dc\\u10e2\\u10dd\\u201c \\u10d3\\u10d0 \\u10e8\\u10d4\\u10e1\\u10d0\\u10eb\\u10da\\u10dd\\u10d0, \\u10e0\\u10dd\\u10db \\u10d8\\u10d2\\u10d8 \\u10d0\\u10e0 \\u10d2\\u10d0\\u10db\\u10dd\\u10ee\\u10d0\\u10e2\\u10d0\\u10d5\\u10d3\\u10d4\\u10e1 \\u10d4\\u10d5\\u10e0\\u10dd\\u10d9\\u10d0\\u10d5\\u10e8\\u10d8\\u10e0\\u10d8\\u10e1 \\u10e8\\u10d4\\u10ee\\u10d4\\u10d3\\u10e3\\u10da\\u10d4\\u10d1\\u10d4\\u10d1\\u10e1.\",\"en\":\"The information portal for youth was developed within the \\u201cEU4Youth: Better Skills for Better Future\\u201d project, which is implemented in 3 countries of Eastern Partnership \\u2013 Armenia, Georgia and Ukraine. The project is supported by the European Union and implemented by the international non-governmental organization Save the Children. Save the Children\\u2019s implementing partner in Georgia is the Youth Agency.The projects aims at promoting youth policies that are effective, gender sensitive, inclusive through youth in multi-stakeholder policy dialogue. Its objectives are: 1) Advocate for coherent and cross-sectorial youth policies at local, regional and national levels; 2) Contribute to developing the entrepreneurial potential of disadvantaged youth; and 3) Ensure increased access of youth to non-formal education and training opportunities for greater employability.Save the Children is the world\\u2019s leading independent organization for children. Its vision is a world in which every child attains the right to survival, protection, development and participation. Its mission is to inspire breakthroughs in the way the world treats children, and to achieve immediate and lasting change in their lives.This publication was produced with the support of the European Union. Its contents are the sole responsibility of Save the Children and the Youth Agency and do not necessarily reflect the views of the European Union.\"},\"updated_at\":\"2020-02-17 07:20:37\",\"created_at\":\"2020-02-17 07:20:37\",\"id\":1}');
