(77, '8fe82157-677a-4c2e-a26a-f748c80266d2', 1, 'Update', 'App\\StaticDataAboutUs', 1, 'App\\StaticDataAboutUs', 1, 'App\\StaticDataAboutUs', 1, '', 'finished', '', '2020-02-21 07:52:25', '2020-02-21 07:52:25', '{\"about_us_text\":\"{\\\"en\\\": \\\"The information portal for youth was developed within the \\u201cEU4Youth: Better Skills for Better Future\\u201d project, which is implemented in 3 countries of Eastern Partnership \\u2013 Armenia, Georgia and Ukraine. The project is supported by the European Union and implemented by the international non-governmental organization Save the Children. Save the Children\\u2019s implementing partner in Georgia is the Youth Agency.The projects aims at promoting youth policies that are effective, gender sensitive, inclusive through youth in multi-stakeholder policy dialogue. Its objectives are: 1) Advocate for coherent and cross-sectorial youth policies at local, regional and national levels; 2) Contribute to developing the entrepreneurial potential of disadvantaged youth; and 3) Ensure increased access of youth to non-formal education and training opportunities for greater employability.Save the Children is the world\\u2019s leading independent organization for children. Its vision is a world in which every child attains the right to survival, protection, development and participation. Its mission is to inspire breakthroughs in the way the world treats children, and to achieve immediate and lasting change in their lives.This publication was produced with the support of the European Union. Its contents are the sole responsibility of Save the Children and the Youth Agency and do not necessarily reflect the views of the European Union.\\\", \\\"ka\\\": \\\"\\u10e0\\u10d0 \\u10d0\\u10e0\\u10d8\\u10e1 \\u201e\\u10d0\\u10ee\\u10d0\\u10da\\u10d2\\u10d0\\u10d6\\u10e0\\u10d3\\u10dd\\u10d1\\u10d8\\u10e1 \\u10de\\u10da\\u10d0\\u10e2\\u10e4\\u10dd\\u10e0\\u10db\\u10d0\\u201c? \\\\n \\\\n\\u201e\\u10d0\\u10ee\\u10d0\\u10da\\u10d2\\u10d0\