(26, '{\"en\": \"For Bettre Future\", \"ka\": \" \"}', 'uketesimomavlisatvis@gmail.com', '599410250', '598316299', '205283281', 1, '{\"en\": \"<p>Georgia, Mtskheta-Mtianeti region 3318; Tserovani IDP&rsquo;s settlement str.11 cottage 1624/15</p>\", \"ka\": \"<p>,  , 3318;   , .11  1624/15</p>\"}', '$2y$10$T0sEk/.j.EM4feGylTKBKeZgW.2ggBcIWzWjBq/vKowpzbfyeu9Ne', '{\"en\": \"<p>The organization was established in 2009 In Tserovani IDP Settlement.</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Vision Statement</strong></p>\\r\\n\\r\\n<p>We believe that all people deserve strong civil society institutions based on active participation, freedom of speech, and corporate social responsibility</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Mission Statement</strong></p>\\r\\n\\r\\n<p>Our mission is to strengthen Mtskheta-Mtianeti&rsquo;s civil society by supporting community members and local initiatives</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; In 2008, For Better Future joined the &ldquo;Coalition for IDP&rsquo;s Rights&rdquo; &nbsp;<a href=\\\"http://www.idp.ge/\\\">www.idp.ge</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2009, For Better Future has been member of the Civil Forum - Place For Peace <a href=\\\"http://www.civil-forum.org/\\\">www.civil-forum.org</a>&nbsp;&nbsp;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2012, For Better Future has been a member of the Regional Network of Civil Society Organizations &nbsp;&nbsp;<a href=\\\"http://www.cso.ge/\\\">http://www.cso.ge</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2012, For Better Future has been a member of the Gender Equality Network</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; From 2013-2015 and 2015-present, Peace Corps Volunteers have worked on For Better Future organization&rsquo;s team <a href=\\\"http://www.peacecorps.gov/\\\">http://www.peacecorps.gov</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2014 For Better Future is a hosting organization for EVS (European Voluntary Service). <a href=\\\"https://ec.europa.eu/programmes/erasmus-plus/opportunities-for-individuals/young-people/european-voluntary-service_en\\\">europa.eu</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2015 For Better Future has been a member of CSO Network working with&nbsp; war affected population-&nbsp; &ldquo;Movement &nbsp;for Wellbeing&rdquo; <a href=\\\"https://www.facebook.com/%E1%83%A5%E1%83%A1%E1%83%94%E1%83%9A%E1%83%98-%E1%83%9B%E1%83%9D%E1%83%AB%E1%83%A0%E1%83%90%E1%83%9D%E1%83%91%E1%83%90-%E1%83%99%E1%83%94%E1%83%97%E1%83%98%E1%83%9A%E1%83%93%E1%83%A6%E1%83%94%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1%E1%83%97%E1%83%95%E1%83%98%E1%83%A1-Network-Movement-for-Wellbeing-127458621030847/?fref=ts\\\">Network Movement for Wellbeing</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2014 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a member of the Network of Social Enterprise Organizations of Georgia</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2016 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a co-founder of CSO &ldquo;Social <!--[if gte mso 9]><xml>\\r\\n <o:OLEObject Type=\\\"Embed\\\" ProgID=\\\"AcroExch.Document.DC\\\" ShapeID=\\\"_x0000_i1025\\\"\\r\\n  DrawAspect=\\\"Icon\\\" ObjectID=\\\"_1648542219\\\">\\r\\n </o:OLEObject>\\r\\n</xml><![endif]-->Enterprise Alliance&rdquo; &nbsp;&nbsp;of Georgia</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2016 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a member of &ldquo;Georgian Craft Association&rdquo;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2017, For Better Future signed the memorandum of cooperation together with the organization &ldquo;Interkultura&rdquo;- Republic of Macedonia and &ldquo;SV-Platform&rdquo; &ndash; from Ukraine. The purpose of the memorandum is to strengthen the cooperation and interconnection of the organizations in the economic, social, cultural, educational and scientific fields.</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p>Most of our organization&rsquo;s beneficiaries are IDPs from the 2008 conflict and they have limited communication with residents of the occupied territory. Therefore, the peacebuilding and conflict-resolution process for the South Ossetia region is a primary focus for our organization.&nbsp; We collaborate with international organizations and local nongovernmental organizations to promote confidence-building and dialogue techniques. Since 2009, our organization has actively participated in the Georgian-Ossetian negotiation process; bringing together civil society organizations from the Tskhinvali region and from Georgia to participate in dialogues on neutral territory. For Better Future also works with ethnic minorities in Georgia, including Ossetian people currently living in the occupied territory. One of organization&rsquo;s main priorities is to develop civil society organizations in Mtskheta-Mtianeti region and promote their affective and active civic participation.</p>\", \"ka\": \"<p> 2009     </p>\\r\\n\\r\\n<p><strong></strong></p>\\r\\n\\r\\n<p>  -     ,    , ,   .       ,    /,            .</p>\\r\\n\\r\\n<p><strong></strong></p>\\r\\n\\r\\n<p>   -          ()        .</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2008   &bdquo;  &ldquo; . <a href=\\\"http://www.idp.ge\\\">www.idp.ge</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2009  &bdquo;  -  &ldquo; . <a href=\\\"http://www.civil-forum.org\\\">www.civil-forum.org</a>&nbsp;&nbsp;</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012       <a href=\\\"http://www.cso.ge\\\">http://www.cso.ge</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012   &nbsp;&nbsp;    .</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013       <a href=\\\"http://www.peacecorps.gov\\\">http://www.peacecorps.gov</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014   :   EVS (  )  . <a href=\\\"https://ec.europa.eu/programmes