(9, '{\"en\": \"Call for European School Summer Camp 2020 in Georgia\", \"ka\": \"Call for European School Summer Camp 2020 in Georgia\"}', '{\"en\": \"<p>LEPL &bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.<br />\\n<br />\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.<br />\\n<br />\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.<br />\\n<br />\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.<br />\\n<br />\\nThe application deadline is <strong>Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia</strong>.<br />\\n<br />\\nYouth Agency has been implementing this project since 2018.Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community.<br />\\n<br />\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;.<br />\\n<br />\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).</p>\", \"ka\": \"<p>LEPL &bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.<br />\\n<br />\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.<br />\\n<br />\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.<br />\\n<br />\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.<br />\\n<br />\\nThe application deadline is <strong>Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia</strong>.<br />\\n<br />\\nYouth Agency has been implementing this project since 2018.Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community.<br />\\n<br />\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;.<br />\\n<br />\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).</p>\"}', '{\"en\": \"<p>, -  N76</p>\", \"ka\": \"<p>, -  N76</p>\"}', '41.723090', '44.731563', '+995 599 877 114', '2020-03-20', '2020-04-16', '2020-03-19', 1, NULL, 'c320lOFRoL7VLqyP0PAc8wNx0hNW2GH4EVzntHXm.jpeg', 2, 'https://www.facebook.com/events/2336261993141773/', NULL, 'eapsummercamp2020@gmail.com', '2020-03-19 13:37:11', '2020-04-07 10:15:17', 'https://docs.google.com/forms/d/e/1FAIpQLSdraER_wXYmFSjd_RzAhSvUjyhuqzzpmRA6KyrhGPtx7S_TkQ/viewform', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
