3. Ana Tsanava - Women\'s Economic Empowerment in Georgia: Opportunities and Challenges<br>4. Nino Gelenidze - Women and Leadership<br>5. Marina Kurtanidze  womens involvement in wine business: sharing personal experience<br>6. Dimitri Tskitishvili - Women\'s participation in socio-political processes<br>7. Nino Kalandia - Difficulties in a woman\'s life: a stigmatized society<br>8. Dato Liklikadze - Gender Equality in Georgia<br>9. Anuka Nakashidze - Gender Stereotypes in Georgia<br>10. Luiza Mutoshvili - Feminism<br>11. Raisa Liparteliani - Gender Equality and Women\'s Labor Rights<br>12. Ia Nioradze - Female Manager: Sharing personal experience<br>13. Sopho Badiashvili - The Role of Women in Modern Society: Sharing Personal Experiences<br>14. Tika Rukhadze - The role of women in public life<br>15. Anna Secretary - Woman as a media representative<br>16. Eka Laliashvili - The Role of Women in Modern Society: Sharing Personal Experiences<br>17. Mariam Khuroshvili - How women are empowered within the EaP<br>18. Tinatin Japaridze - The role of women in the security sector<br>19. Nino Gogokhia - 22-year-old Pike at the UN: Sharing personal experiences<br>20. Nana Gogokhia - Woman as a leader<br>21. Ia Imerlishvili - Women Entrepreneurs: Sharing Personal Experience<br>22. Mariam Mirotadze - Women in the Wine Business: Sharing Personal Experiences<br>23. Rusudan Gotsiridze - The face and role of a woman in modern life<br>24. Zaal Chkheidze - Some stereotypes and women as narrators<br>25. Natia Koberidze - The Importance of Women\'s Economic Empowerment<br>26. Tea Aduashvili - Women\'s Involvement in Business: Sharing Personal Experiences<br>27. Tamar Kanashvili - The role of women in modern society<br>28. Baia Abuladze - Women in Entrepreneurship: Sharing Personal Experiences<br>29. Nino Elbakidze- womens political participation<br>30. Khatuna Ketiladze - How to get rid of the abuser<br>31. Tea Makhatelashvili - Women in the Wine Business: Sharing Personal Experiences<br>32. Keto Ninidze - Women in the Wine Business: Sharing Personal Experiences<br>33. Lela Akiashvili - Gender Equality and Women\'s Rights<br>34. Tamar Liluashvili - The role of women in diplomacy<br>35. Elene Janelidze - Women Human Rights Defenders in Georgia and the World - Obstacles and Challenges<br>36. Zaira Jibladze - Women in the Wine Business: Sharing Personal Experiences</p><p>-----------------------------------------<br>We would also like to inform you that within the framework of the \\\"Week for Women\'s Empowerment\\\" and \\\"Mirabaldebi\\\"s main project \\\"Education against Violence\\\", a reading space named after Ana (Olga) Sologashvili is being organized at the Gori State Shelter for Victims of Domestic Violence. For doing this, we need the support of the public. If you wish, you can transfer the amount to the following details:</p><p>Details: NNLE \\\"Mirabaldebi\\\"<br>Said. Code: 404561318<br>Bank Code: BAGAGE22<br>A / A GE43BG0000000101303538</p>\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p></p>\"}', NULL, NULL, NULL, '2021-05-17', '2021-05-25', '2021-05-20', 101, NULL, '86__2021-05-2011:15:54.png', NULL, NULL, NULL, NULL, '2021-05-20 11:12:18', '2021-05-25 09:13:53', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
