(133, '{\"en\": null, \"ka\": \"Think Green Keep It Clean\"}', '{\"en\": null, \"ka\": \"<p>For English scroll down</p><p>     , Gino Paradise - ,        .           .</p><p> :</p><p>? , 29  15:00 ;</p><p>?   . : <a href=\\\"http://shorturl.at/krSW2?fbclid=IwAR3xvi1L4t3i2LIrl7Q30PzlTuoMfS4rVV462JQwsAlBUxNNouotpMaufrw\\\">shorturl.at/krSW2</a></p><p>?        .    :   24/89 14:30 . ,  ,  ;    : <a href=\\\"https://g.page/droniorg?share&amp;fbclid=IwAR1FR8JXeW1gl84iLXiCMDOHWIURbjitJQzt0-PH88ayasLccpCIyctLWyY\\\">https://g.page/droniorg?share</a></p><p>     : <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F2QIAUtR%3Ffbclid%3DIwAR0pbopm3MYExhheMoXXdoB_aClZdwqubHuWAvvV3PxHTnq9a8GL9vB6-Ko&amp;h=AT3ooVX32akxgEPpDUf_4pimF5LQ572SJCoKKIi-J4v77uOJzqVtYwy3MPvRcLGEODvJBGblSNqWnpXkGioE2g1nb6ERbwEPB7B-rnjbVvGP8bhDIQdXfZWvPHuZTjUXb7JI&amp;__tn__=q&amp;c[0]=AT0wYXhqHnnCaRY__FfnGIIGIfhwUtRBezYYvqer-D-JIkx_esRaxETM8lWyhlX7mKOJb3zcBzZWmO-9wf6j-CajLumD3euRhLe4rYz0GB3l61ZFOb0OdNhnIypZAGGnHNWTao3QLmHABUmjkvOoHC91\\\">https://bit.ly/2QIAUtR</a><br>   :   - achitsulaia@gmail.com; 593 523 627    - 579 78 05 19 avtandilvardiashvili@gmail.com;</p><p> :<br>   : ,   .      ,    .</p><p>.     ,         .</p><p>ENG<br>Dear all !!<br>The idea is to meet up at Tbilisi sea, close to Gino Paradise Resort, bring as many friends as possible, and together collect the trash that is polluting the area of the Tbilisi sea. After the event, we can all have a picnic and enjoy some good music and the rest of the day in a beautiful location.</p><p>Here is the plan:</p><p>WHEN? --&gt; Saturday 29th of May 2021, at 15:00</p><p>WHERE? --&gt; Next to Gino Paradise, Tbilisi sea (<a href=\\\"http://shorturl.at/krSW2?fbclid=IwAR2_ebwtJDE-1zSQgtLbSN4dSIhZ-Uv8ldD9_YI1-wsXppuE40V06U00b8k\\\">shorturl.at/krSW2</a>)</p><p>HOW? --&gt; you can reach the place by yourself in Marjianishvili 24/89, we are organizing Minibus leaving from here at 2.30pm. But please let us know if you want to reserve a seat! Minibus leaves from here: <a href=\\\"https://g.page/droniorg?share&amp;fbclid=IwAR0cE8V1vvG1sxEndrolFBjeO51AKpCh2rrIvknY09UZS4K3xeTfdBZ8z5E\\\">https://g.page/droniorg?share</a></p><p>Please register on the following link: <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F2QIAUtR%3Ffbclid%3DIwAR28N4yXX6T3FgmM7qHm4kZkTHzzeZ1eQQ9MR-pY5lnNd-IJ1rwGDyDYtNs&amp;h=AT3ooVX32akxgEPpDUf_4pimF5LQ572SJCoKKIi-J4v77uOJzqVtYwy3MPvRcLGEODvJBGblSNqWnpXkGioE2g1nb6ERbwEPB7B-rnjbVvGP8bhDIQdXfZWvPHuZTjUXb7JI&amp;__tn__=q&amp;c[0]=AT0wYXhqHnnCaRY__FfnGIIGIfhwUtRBezYYvqer-D-JIkx_esRaxETM8lWyhlX7mKOJb3zcBzZWmO-9wf6j-CajLumD3euRhLe4rYz0GB3l61ZFOb0OdNhnIypZAGGnHNWTao3QLmHABUmjkvOoHC91\\\">https://bit.ly/2QIAUtR</a><br>for any additional information you can contact: Archil Tsulaia - achitsulaia@gmail.com or Avtandil Vardiashvili - avtandilvardiashvili@gmail.com;</p><p>What else?<br>We will bring music, food, water, and a lot of good vibes! You just need to remember to bring your reusable cup or bottle, the least waste we create, the better for the environment!<br>So don\'t hesitate and join us, you\'ll have the opportunity to meet new people, have a lot of fun and do your part for the planet!!</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-29', '2021-05-29', '2021-05-27', 27, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-27 13:47:45', '2021-05-27 14:33:15', 'https://bit.ly/2QIAUtR', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
