(271, '{\"en\": null, \"ka\": \"Dance Up Your Life\"}', '{\"en\": null, \"ka\": \"<p><strong>! OPPORTUNITY !&nbsp;</strong></p><p>Do you want to change your life together with 35 other people from <a href=\\\"https://www.facebook.com/hashtag/latvia?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#Latvia</a>, <a href=\\\"https://www.facebook.com/hashtag/spain?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#Spain</a>, <a href=\\\"https://www.facebook.com/hashtag/portugal?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#Portugal</a>, <a href=\\\"https://www.facebook.com/hashtag/lithuania?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#Lithuania</a> and <a href=\\\"https://www.facebook.com/hashtag/georgia?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#Georgia</a>?</p><p>Do you like to #dance and <a href=\\\"https://www.facebook.com/hashtag/express?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#express</a> <a href=\\\"https://www.facebook.com/hashtag/yourself?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#yourself</a>? Or maybe you want to <a href=\\\"https://www.facebook.com/hashtag/learn?__eep__=6&amp;__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=*NK-y-R\\\">#learn</a> how to do it?Do you want to spend 12 days surrounded by amazing people? And do you want to learn new #skills?</p><p><strong>! YOU CAN DO IT !&nbsp;</strong></p><p>International camp/project is waiting for you!</p><p><strong>Name:</strong> Dance up Your Life</p><p><strong>Type of activity: </strong>Youth exchange</p><p><strong>Dates: </strong>25 AUGUST - 5 SEPTEMBER 2021</p><p><strong>Place:</strong> <a href=\\\"https://www.facebook.com/campingergli/?__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=kK-y-R\\\">Camping \\\"rgi\\\"</a> in Bernti, Latvia</p><p><strong>Working language:</strong> English</p><p><strong>Age limit: </strong>From 18 till 29</p><p>&nbsp;</p><p><strong>NO PARTICIPATION FEE!</strong></p><p>Activity is co-funded by the Erasmus+ programme of the European Union. Travel costs needs to be paid by participants first and after the project will be reimbursed by organisers.</p><p><strong>Official partners:</strong></p><p>Latvia - <a href=\\\"https://www.facebook.com/keepthechangelatvia/?__cft__%5B0%5D=AZU0bVm0LeKKCZ7oOhX68N84WPhazi0vb5E1po8mzfyaeQmQ47yQJVWf50jXcuu52ctsCFz2q8BoWG8jIAcURaaBpWiBdtcP8aJ7vw43VouneQZA27l0kSD7V9K4LcbndszygIMaRZrgIz3gUc_b9LmvlhAXja9CL7_2AOzkMI6sqw&amp;__tn__=kK-y-R\\\">Keep the Change</a></p