(316, '{\"en\": null, \"ka\": \"Russian Hybrid Warfare and NATO\'s Deterrence Posture\"}', '{\"en\": null, \"ka\": \"<p><strong>Russian Hybrid Warfare and NATO\'s Deterrence Posture</strong></p><p>On 12 July, Lieutenant General (Retd) Ben Hodges will discuss Russian hybrid warfare and NATOs deterrence posture vis--vis hybrid threats.</p><p>The project is organized by the Youth Atlantic Treaty Association of Georgia (YATA Georgia) that aims to increase awareness about NATO and NATO-Georgia relations and supports extensive research on the security issues in the region.</p><p>Ben Hodges is a retired United States Army officer who served as commanding general, United States Army Europe. He is currently the Pershing Chair in Strategic Studies at the Center for European Policy Analysis. He retired from the army and relinquished command of USAREUR on 15 December 2017.</p><p>Moderator:<br>Tekla Gabritchidze -International Relations expert, ELTE University graduate.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t92/1.5/16/1f4e2.png\\\" alt=\\\"\\\"></figure><p>Since the 2008 Russo-Georgian war, and more prominently on the international stage, since the annexation of Crimea, the term hybrid warfare, more often than not, connotes the Russian Federation and its ventures against the West. Hybrid methods of warfare, such as propaganda, deception, sabotage, and other non-military tactics have long been used to destabilize adversaries. What is new about attacks seen in recent years is that only the facets  speed, tactics, and tools converged to the present times.<br>Over the following decades, hybrid threats facing NATO are likely to grow in complexity and intensity.Information operations, cyber-attacks, subversion, low-level conflict, and other hybrid challenges that can be blended with conventional warfare will be exacerbated by rapid technological change and global connectivity.</p><p>&nbsp;</p><p>Registration link:<br><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3hsjD2O%3Ffbclid%3DIwAR3atTRvV5R_ci63pocOc1RpEYAacix006VUJdciE5gQA_angc6IPrqsqVA&amp;h=AT2kB70NLNNPknb-_ZjYgNizBUDHlwSjR6BeH2qDwyL90NcskgdXEur3i1jjmLmRi_osgQxc0rXGgFX_ZSMlZTqyKZfx_A0qi1JN_tdpB6hK5gxXK1de8E_1S45IAAe72mHM&amp;__tn__=q&amp;c[0]=AT1DDRpPfFGSl4X8C3nxxs-LFklmdVfHCloxO_1pSYnyVJfO9FNBYhGSU5n1ZY5Dexe6VKLImUE5CkcJiBIYmg8ExL5ZAqmayGbOvq0UDgA3npPQf8ap49gtGZ2JA4Pjd_RJ1WjBQuFpQ1iVVP_6-DTcwa2sBCm3btAhyPCbNXEP5861\\\">https://bit.ly/3hsjD2O</a></p><p>&nbsp;</p><p>Join us on Monday, 12 July, at 10:00 AM (CET) / 12:00 PM (GMT+4)</p><p>The working language - English<br>Webinar will be held on Zoom platform.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-12', '2021-07-12', '2021-07-10', 148, NULL, '316__2021-07-1019:43:18.png', NULL, NULL, NULL, NULL, '2021-07-10 19:16:33', '2021-07-10 19:43:19', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
