(334, '{\"en\": null, \"ka\": \"Fellowship at Batumi Municipality Internal Audit Unit\"}', '{\"en\": null, \"ka\": \"<p>USAID/Good Governance Initiative (GGI) Fellowship Program in Batumi Municipality Internal Audit (IA) Unit.<br><br>About GGI:<br><br>The Good Governance Initiative (GGI) is a five-year program funded by USAID and implemented by Tetra Tech ARD. The overall goal of the project is to strengthen transparency, accountability, and effectiveness of governance in Georgia, including the legislative and executive branches at various levels. One of GGI`s partners are Batumi Municipality, where the project focuses on the development of various strategic documents as well as on the capacity building of staff for effective implementation of the public finance management reform, among others.<br><br>The Fellowship:<br><br>To help contribute to its efforts, GGI is currently recruiting a fellow to be placed at <strong>GGI`s partner Batumi Municipality Internal Audit (IA) Unit</strong>. Successful applicant will have an unique opportunity to acquire first-hand experience in municipality operetions; municipal services, accounting and budgetary process; internal financial controls and internal audit.<br><br>GGI fellowship is a full-time, five-months program covering the period September 1st, 2021 - January 31st, 2022.<br><br>Required Qualifications:<br><br>** Bachelor/Master`s degree or final course student in economics, finance, business/public administration and management, public policy or law;<br>** Good understanding and keen interest in:<br>** public policy issues, especially economic policy and development, fiscal and monetary policy, state budget;<br>** state and local governance role;<br>** Strong research and analytical skills;<br>** Excellent written and verbal communication skills, both in English and in Georgian languages;<br>** Excellent computer and social media skills.<br><br>Responsibilities:<br><br>** Participation in the municipal internal audit process;<br>** Participation in the process of preparing internal audit unit strategic documents as well as capacity building activities;<br>** Working with databases and information processing, sorting, reflection during the audit engagements;<br>** Perform other tasks assigned by the unit head.<br><br>Management and Working Environment:<br><br>The fellow will be based in Batumi municipality Internal Audit (IA) Unit and will be accountable to the IA Unit Head and to GGI team. The fellow will receive monthly allowance of USD 250 (Gross).<br><br>Training:<br><br>Upon commencement of the fellowship, the fellow will be provided with orientation training on the GGI project and its activities as well as administrative procedures and reporting. Additional training opportunities may be offered through GGI`s programmatic activities.<br><br>How to Apply:<br><br>Interested candidates are invited to submit their CVs (in English or Georgian. No photos, please!) and cover letters (in English) to: <a href=\\\"mailto:recruitment@ggi.ge?subject=\\\">recruitment@ggi.ge</a><br><br>In their cover letters, applicants should describe reasons for their interest in GGI`s fellowship program.<br><br>While GGI will try to consider the preferences of successful candidates, it can give no guarantees to the applicants. Only complete applications will be reviewed and considered.<br><br>The deadline for applications is <strong>August 8, 2021</strong> and indicate \\\"Batumi Municipality - Internal Audit Unit\\\" in the e-mail subject line.<br><br>Only short-listed candidates will be invited for a written test and a subsequent interview. No telephone calls will be taken for these positions.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-26', '2021-08-08', '2021-07-26', 161, NULL, NULL, NULL, NULL, NULL, NULL, '2021-07-26 12:06:26', '2021-07-26 12:08:02', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
