(355, '{\"en\": null, \"ka\": \"International Rural Acceleration Program - \'Youth for Sustainable Rural Development\'\"}', '{\"en\": null, \"ka\": \"<p>Would like to create and develop your innovative social enterprise and work in an international team of young people with the help of trainers and mentors?<br><br>Then we are happy to invite you to participate in the international rural acceleration program Youth for Sustainable Rural Development, which aims to motivate, encourage and enable young people from rural areas to create innovative eco-social enterprises and sustainable communities with equal opportunities for everyone.</p><p>The project is implemented by the Entrepreneurs Association Georgia in partnership with ThinkCamp Germany.<br><br><strong>The project is funded under the grant program MEET UP! Youth for Partnership by the Remembrance, Responsibility, and Future (EVZ) Foundation and the Federal Foreign Office.</strong></p><p><strong>#MEETUPforPartnership #YOUTHforPartnership&nbsp;&nbsp;</strong><br><br>In the framework of the project 15 Georgian and 15 German participants aged between 18 years and 35 years will be selected, who are willing to spend the fall working on fascinating social enterprise projects in rural areas. There is no fee for your participation. Costs related to travel, accommodation, and meals will be covered by the project.</p><p><i>Project activities include:</i></p><ul><li>Kick-off meeting - August&nbsp;25, 2021</li><li>Working meeting - September&nbsp;2-8, 2021</li><li>Working meeting - November&nbsp;28-December&nbsp;3, 2021</li><li>International masterclasses :</li></ul><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 21.09.2021</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 05.10.2021</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 19.10.2021</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 02.11.2021</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 23.11.2021</p><ul><li>Demo day  December&nbsp;14, 2021</li></ul><p>In case of your interest please fill in the online application form until August 20:</p><p>Application form for the Georgian participants:&nbsp;<a href=\\\"https://bit.ly/2Tm3GC3\\\">https://bit.ly/2Tm3GC3</a>&nbsp;</p><p>Application form for the German participants:<a href=\\\"https://bit.ly/2W7AMXb\\\">https://bit.ly/2W7AMXb</a>&nbsp;</p><p><strong>Q&amp;A:</strong></p><p>For questions you are welcome to contact project organizers :</p><ul><li>Georgia -&nbsp;<a href=\\\"mailto:tinatin@entrepreneurs.ge\\\">tinatin@entrepreneurs.ge</a></li><li>Germany -&nbsp;<a href=\\\"mailto:johannes.pfister@thinkcamp.eu\\\">johannes.pfister@thinkcamp.eu</a></li></ul><p>Please find additional information with the attached info-pack -&nbsp;<a href=\\\"https://bit.ly/3rUItfd\\\">https://bit.ly/3rUItfd</a>&nbsp;</p>\"}', '{\"en\": \"hybrid format\", \"ka\": \"hybrid format\"}', '41.72211253715028', '44.72616976147563', NULL, '2021-08-25', '2021-12-14', '2021-08-03', 164, NULL, '355__2021-08-0314:43:28.png', NULL, 'https://www.facebook.com/EntrepreneursGeorgia', NULL, 'https://entrepreneurs.ge', '2021-08-03 13:42:55', '2021-08-03 14:45:04', 'https://bit.ly/2Tm3GC3', NULL, 1, 0, 'tinatin@entrepreneurs.ge', 18, 35, 0, NULL, NULL, 0, NULL, 0),
