(370, '{\"en\": null, \"ka\": \",  ! COY16 | Youth Voices Collection\"}', '{\"en\": null, \"ka\": \"<p>      ?,  &nbsp;<strong> COY16</strong>-       <strong>Youngo</strong> -              ? &nbsp;      !    ,  .      , <a href=\\\"https://www.linkedin.com/in/mariam-avakova/\\\"> &nbsp;</a></p><p><a href=\\\"https://tinyurl.com/COY16Unmute?fbclid=IwAR0lqrrr3JPKbukPPYsLqjzmiQNA9pjI5uRJvGoFWykEYKtAB2LotAM9gUc\\\">https://tinyurl.com/COY16Unmute</a></p><h3><strong>COY16 | Youth Voices Collection</strong><br><br>Become involved, become the change!&nbsp;</h3><ul><li>COY16 and Youngo - International Youth Climate Movement, have launched a new way for you to become part of our final Youth Statement. By filling this form, you will contribute to the Global Youth Statement, thus the youth\'s voice in the COP26 negotiations.</li></ul><figure class=\\\"image image-style-side\\\"><img src=\\\"https://youthplatform.gov.ge/storage/ck/gZCbUkeY26XsrZvLTA06GjMx1z0NX0LOhzuVS2Zz.jpeg\\\"></figure><blockquote><p>Your input will be added to your respective country\'s Statement, and the data gathered via this form will be analysed to create the final output of COY16.<br><br>This form is intended to gather input from young people around the world to be considered when creating the Global Youth Statement, which will constitute the youth\'s voice in the COP26 negotiations. The data gathered via this form will also be analysed to generate a report on youth engagement within the climate movement.<br><br>By filling out this form you are contributing to your country\'s representation in drafting the global youth statement. Although we cannot guarantee all aspects you provide will be fully included in the final statement, your feedback will be utilised in drafting the various statements and, therefore, will be reflected in the Youth Policy Document to COP26.</p></blockquote><p>Find the Youth Voices Collection Form here! <a href=\\\"https://tinyurl.com/COY16Unmute?fbclid=IwAR08ZEL3oWVxdsDXz2dS5wiV