(1, '{\"en\": null}', '{\"en\": \"About Us\", \"ka\": \" \"}', '{\"en\": \"<p>The information portal for youth was developed within the &ldquo;EU4Youth: Better Skills for Better Future&rdquo; project, which is implemented in 3 countries of Eastern Partnership &ndash; Armenia, Georgia and Ukraine. The project is supported by the European Union and implemented by the international non-governmental organization Save the Children. Save the Children&rsquo;s implementing partner in Georgia is the Youth Agency.The projects aims at promoting youth policies that are effective, gender sensitive, inclusive through youth in multi-stakeholder policy dialogue. Its objectives are: 1) Advocate for coherent and cross-sectorial youth policies at local, regional and national levels; 2) Contribute to developing the entrepreneurial potential of disadvantaged youth; and 3) Ensure increased access of youth to non-formal education and training opportunities for greater employability.Save the Children is the world&rsquo;s leading independent organization for children. Its vision is a world in which every child attains the right to survival, protection, development and participation. Its mission is to inspire breakthroughs in the way the world treats children, and to achieve immediate and lasting change in their lives.This publication was produced with the support of the European Union. Its contents are the sole responsibility of Save the Children and the Youth Agency and do not necessarily reflect the views of the European Union.</p>\", \"ka\": \"<p style=\\\"text-align:start\\\"><strong>    ?</strong></p>\\n\\n<p style=\\\"text-align:start\\\">&bdquo; &ldquo;,        .        ,   . &nbsp;&bdquo; &ldquo; ,          .</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>  :</strong>     ,    ; , , , ,            , &bdquo; &ldquo; ,   .</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>  :</strong> &bdquo; &ldquo;, , , ,             ,    , , ,    .</p>\\n\\n<p style=\\\"text-align:start\\\"><s