INSERT INTO `study_cabinets` (`id`, `name`, `description`, `duration`, `team_size`, `activity_size`, `activity_level`, `image`, `user_id`, `company_id`, `status`, `created_at`, `updated_at`) VALUES
(1, '{\"ka\":\"asd\",\"en\":\"asdasd\"}', '{\"ka\":\"<p>asdasd&nbsp;Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do?<\\/p>\",\"en\":\"<p>asdasd&nbsp;Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do?<\\/p>\"}', 'asdasd', 'asdasd', 'asdasd', 'asdasd', '/storage/study_cabinet/FIZMClepvt5sIOQKi8kgOb4cwi4mrKZ8iTAbfsNx.jpeg', 937, NULL, 1, '2022-11-22 04:22:13', '2022-12-22 04:38:57'),
(2, '{\"ka\":\"zxczxc\",\"en\":\"zxczxc\"}', '{\"ka\":\"zxczxczx\",\"en\":\"zxczxczx\"}', 'zxcz', 'zxczxc', 'zxczxc', 'zxczxc', '/storage/study_cabinet/vB6HmP1DDzMXDjwkwadisCiYGC9ntdIoW0ghsqU9.jpeg', 937, NULL, 0, '2022-11-22 04:32:06', '2022-11-22 04:32:06'),
(3, '{\"ka\":\"Take a step forward\",\"en\":\"Take a step forward\"}', '{\"ka\":\"<p>Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do? &sect; What is your everyday life like now? Where do you socialise? What do you do in the morning, in the afternoon, in the evening? &sect; What sort of lifestyle do you have? Where do you live? How much money do you earn each month? What do you do in your leisure time? What you do in your holidays? &sect; What excites you and what are you afraid of?<\\/p>\",\"en\":\"<p>Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do? &sect; What is your everyday life like now? Where do you socialise? What do you do in the morning, in the afternoon, in the evening? &sect; What sort of lifestyle do you have? Where do you live? How much money do you earn each month? What do you do in your leisure time? What you do in your holidays? &sect; What excites you and what are you afraid of?<\\/p>\"}', '60 minutes', '10-30', '1234', '1234', '/storage/study_cabinet/bx2afoGKqRv9LDBtaf0u1ccWVp2VTcsdhwJCFiVZ.jpeg', 944, NULL, 1, '2022-12-14 06:41:49', '2022-12-22 04:01:45'),
